import { Component } from 'react';
import { useLocation } from "react-router-dom";

class Temp extends Component {
    componentWillMount() {
        temp();
      }
    
    temp() {
        const location = useLocation();
        console.log(location.state.id)
      }

    render() {
        return (
            <div>
                <h3>Temp 페이지입니다.</h3>
                   <div>
                       {}
                </div>
            </div>
        );
    }
}

export default Temp;



